import { Fragment } from "react";

function WordDictionary({data}){
    const items = [
        {
            title : "Definition:",
            content : data.meanings[0].definitions[0].definition
        },
        {
            title : "Parts of speech:",
            content : data.meanings[0].partOfSpeech
        },
        {
            title : "Synonyms:",
            content : data.meanings[0].synonyms[0]
        },
        {
            title : "Antonyms:",
            content : data.meanings[0].antonyms[0]
        }
    ]
    const renderedItems = items.map(item=>{
        return(
            <tr className="bg-dark" key={item.title}>
                <td className="text-secondary">{item.title}</td>
                <td>{item.content}</td>
            </tr>
        )
    })
    return(
        <table className="fs-6">
            <Fragment className="p-5"><tbody>{renderedItems}</tbody></Fragment>
        </table>
    )
}
export default WordDictionary;
